    false,nt"url": null,nt"notes": "The Components of Inventory Change (CINCH)
    report measures changes in the characteristics of the housing stock of the United
    States. Using data collected from the national American Housing Survey (AHS), conducted
    every two years, the characteristics of individual housing units are compared across
    time. This comparison allows researchers to see not only changes in the characteristics
    of housing units, but also in the characteristics of occupants. Information is available
    on the characteristics of units added and removed from the housing stock.",nt"license_title":
